.
To make the bacon lentils 
1  10cm portion of speck, rind removed and cut into thin pieces. 
2 cans of brown lentils (well drained and rinsed)
2 cans of diced tomatoes 
2 chilli 🌶 
2 garlic cloves
1 onion, brown
2 tablespoon of smoked paprika 
1 teaspoon of cumin
Fresh oregano, or tablespoon of dry
.
In a heavy pan on a low/ moderate heat fry off the onion, garlic and speck for about 20 mins. Drain off all the fat from the mix and return to the pan. Add  paprika, chilli cumin, oregano and fry off for 5 mins. Add lentils, canned tomato’s and 2 cups of water. Simmer for 20 mins with the lid off until the mix thickens and the lentils are tender. Stir occasionally. Add cracked pepper. 
Served with a fried egg and toast. 
